import React from 'react';
import ReacrDOM from "react-dom";
import add, {subtract, mul, div} from "./App"

ReacrDOM.render(
  <>
  {add(10,5)}
  {subtract(10,5)}
  {mul(10,5)}
  {div(10,5)}
  </>,
  document.getElementById('root')  
);
